int main(void) {
  srand(time(NULL));
  volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
  // Set up double buffering:
  *(pixel_ctrl_ptr + 1) = (int)&Buffer1;  // front buffer = Buffer1
  wait_for_vsync();
  pixel_buffer_start = *pixel_ctrl_ptr;  // point to front buffer
  clear_screen();
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;  // back buffer = Buffer2
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  clear_screen();

  while (1) {
    while (1) {
      //  updateScoreDisplay();
      //  writeWord(score_text, 70, 3);
      read_PS2_Mario();
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);
      plot_image_Start_Screen(0, 0);
      // buffer A
      wait_for_vsync();
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // buffer B
      plot_image_Start_Screen(0, 0);
      wait_for_vsync();  // draw bg to both buffer avoid flickering
      if (Gamestart) {
        Gamestart = false;
        break;
      }
    }
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // buffer A
    plot_image_bg(0, 0);
    wait_for_vsync();

    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // buffer B
    plot_image_bg(0, 0);
    wait_for_vsync();  // draw bg to both buffer avoid flickering
    writeWord(score_text, 70, 3);

    /* timer setup */

    while (1) {
      if (stop) {
        clearcharacters();
        reset_game();
        stop = false;
        plot_image_bg(0, 0);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
        break;
      }

      display_on_hex(time_remaining);

      mario_hit = check_enemy_mario_collisions();

      if (time_remaining <= 0 ||
          mario_hit) {  // stop game if score reaches 5 or time's up!
                        // Display Game Over once:
        plot_image_end_screen(0, 0);
        //  updateScoreDisplay();
        //  writeWord(score_text, 70, 3);

        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
        // Now enter a loop that simply waits for ESC without clearing again:
        while (1) {
          read_PS2_Mario();
          if (stop) {
            break;  // Exit the game-over loop
          }
        }
        clearcharacters();
        // Once exit, reset game
        reset_game();
        stop = false;
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // buffer A
        plot_image_bg(0, 0);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // buffer B
        plot_image_bg(0, 0);
        wait_for_vsync();  // draw bg to both buffer avoid flickering
      }

      check_bullet_enemy_collisions();
      frame_count++;
      erase_each_enemies();
      // --- Enemy Spawning ---
      if (frame_count % 120 == 0) {
        spawn_enemy(initial_speed);

        // Increase speed only when an enemy is spawned
        if (initial_speed < 8) {
          initial_speed += 0.1;
        }
      }
      update_enemies();
      shift_old_positions_enemies();
      erase_image_mario(x_old2, y_old2);

      // Input
      read_PS2_Mario();

      // Bounds check
      if (mario_y < 0) mario_y = 185;
      if (mario_y > 185) mario_y = 0;
	  if (mario_x < 0) mario_x = 0;
	  if (mario_x > 100) mario_x = 0;

      // Fire bullet
      if (fire) {
        bullet_shooting();
        fire = false;
      }
      bullet_update();  // or bullet_update()

      // Draw updated Mario
      plot_image_mario(mario_x, mario_y);

      // Shift tracking positions

      shift_old_positions();
      shift_bull_old_positions();

      // Sync to screen
      wait_for_vsync();
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);

      // increment timer
      if ((frame_count % 60) == 0 && time_remaining > 0) {
        time_remaining--;
      }
    }
  }
  return 0;
}

void clearcharacters() {
  writecharacters(' ', 76, 3);
  writecharacters(' ', 77, 3);
}
void writecharacters(char character, int x, int y) {
  volatile char *char_buffer = (char *)char_base;

  int offset = (y << 7) + x;

  char_buffer[offset] = character;
  return;
}
int string_size(char *word) {
  int size = 0;
  while (word[size] != '\0') {
    size++;
  }
  return size;
}
void writeWord(char *word, int x, int y) {
  int size = string_size(word);
  for (int i = 0; i < size; i++) {
    writecharacters(word[i], i + x, y);
  }
}

void reset_game() {
  // Reset score and frame counter
  time_remaining = 60;
  score = 0;
  frame_count = 0;
  initial_speed = 1.0;  // starting enemy speed

  // Reset Mario's position (update these to your desired starting positions)
  mario_x = 0;
  mario_y = 0;
  mario_hit = false;

  // Reset enemy array: deactivate all enemies and clear their positions
  for (int i = 0; i < Max_Enemies; i++) {
    enemies[i].active = false;
    enemies[i].x = 0;
    enemies[i].y = 0;
    enemiesx_old[i] = enemiesy_old[i] = -100;
    enemiesx_old2[i] = enemiesy_old2[i] = -100;
  }

  // Reset bullet array: deactivate all bullets and clear their positions
  for (int i = 0; i < MAX_BULLETS; i++) {
    bullets[i].active = false;
    bullets[i].x = 0;
    bullets[i].y = 0;
    bullx_old[i] = bully_old[i] = -100;
    bullx_old2[i] = bully_old2[i] = -100;
  }
}

void check_bullet_enemy_collisions() {
  for (int i = 0; i < MAX_BULLETS; i++) {
    if (!bullets[i].active) continue;

    for (int j = 0; j < Max_Enemies; j++) {
      if (!enemies[j].active) continue;

      if (AABB_collision(bullets[i].x, bullets[i].y, BOMB_WIDTH, BOMB_HEIGHT,
                         enemies[j].x, enemies[j].y, Enemies_WIDTH,
                         Enemies_HEIGHT)) {
        // Collision happened!
        score++;
        updateScoreDisplay();
        play_audio(audio_samples, num_samples, 1, 1);


        erase_enemy(enemiesx_old2[j], enemiesy_old2[j], Enemies_WIDTH,
                    Enemies_HEIGHT);
        erase_image_bomb(bullx_old2[i], bully_old2[i]);
        // bullets[i].active = false;=> gives me flickering screen, idk why
        enemies[j].active = false;
        printf("Score: %d\n", score);
        // fflush(stdout);
      }
    }
  }
}

bool AABB_collision(int x1, int y1, int w1, int h1,  // AABB colision checking
                    int x2, int y2, int w2, int h2) {
  return !(x1 + w1 < x2 ||  // left of enemy
           x1 > x2 + w2 ||  // right of enemy
           y1 + h1 < y2 ||  // above enemy
           y1 > y2 + h2);   // below enemy
}

void erase_each_enemies() {
  for (int i = 0; i < Max_Enemies; i++) {
    // Always erase based on previous position (T-2), regardless of active state
    erase_enemy(enemiesx_old2[i], enemiesy_old2[i], Enemies_WIDTH,
                Enemies_HEIGHT);
  }
}
void erase_enemy(int x, int y, int width, int height) {
  for (int row = 0; row < height; row++) {
    for (int col = 0; col < width; col++) {
      int draw_x = x + col;
      int draw_y = y + row;

      if (draw_x >= 0 && draw_x < SCREEN_WIDTH && draw_y >= 0 &&
          draw_y < SCREEN_HEIGHT) {
        int index = draw_y * SCREEN_WIDTH + draw_x;
        short unsigned int color = bg[index];
        plot_pixel(draw_x, draw_y, color);
      }
    }
  }
}

void shift_old_positions_enemies() {
  for (int i = 0; i < Max_Enemies; i++) {
    enemiesx_old2[i] = enemiesx_old[i];
    enemiesy_old2[i] = enemiesy_old[i];

    enemiesx_old[i] = enemies[i].x;
    enemiesy_old[i] = enemies[i].y;
  }
}
