void spawn_enemy(int initial_speed) {
  for (int i = 0; i < Max_Enemies; i++) {
    if (!enemies[i].active) {
      enemies[i].x = 251;
      enemies[i].y = 150;
      enemies[i].speed = initial_speed;
      enemies[i].active = true;
      enemies[i].type = rand() % 2;  // randomly choose GOOMBA or BOO
      break;
    }
  }
}

void update_enemies() {
  for (int i = 0; i < Max_Enemies; i++) {
    if (enemies[i].active) {
      // set velocity to be in direction of mario
      float dx = mario_x - enemies[i].x;
      float dy = mario_y - enemies[i].y;
      float distance = sqroot((dx * dx) + (dy * dy));

      // enemies[i].y -= enemies[i].speed;

      if (distance > 0) {
        dx = dx / distance;
        dy = dy / distance;

        enemies[i].x += (dx * enemies[i].speed);
        enemies[i].y += (dy * enemies[i].speed);
      }

      // Draw the enemy
      if ((enemies[i].type == GOOMBA) &&
          (enemies[i].y <= SCREEN_HEIGHT - Enemies_HEIGHT) &&
          (enemies[i].y >= 0)) {
        plot_image_goomba(enemies[i].x, enemies[i].y);
      } else if (enemies[i].type == BOO &&
                 (enemies[i].y <= SCREEN_HEIGHT - Enemies_HEIGHT) &&
                 (enemies[i].y >= 0)) {
        plot_image_Boo(enemies[i].x, enemies[i].y);
      }

      // Deactivate if fully off screen
      if (enemies[i].y < -Enemies_HEIGHT) {
        enemies[i].active = false;
      }
    }
  }
}

void bullet_update() {  // bullet flying animation
  for (int i = 0; i < MAX_BULLETS; i++) {
    if (bullets[i].active) {
      erase_image_bomb(bullx_old2[i], bully_old2[i]);
      bullets[i].x += 5;
      if (bullets[i].x > SCREEN_WIDTH) {
        bullets[i].active = false;  // make bullet slot avaliable again
      } else if ((bullets[i].x + BOMB_WIDTH < SCREEN_WIDTH)) {
        plot_image_bomb(bullets[i].x, bullets[i].y);
      }
    }
  }
}

void read_PS2_Mario() {
  volatile int *PS2_ptr = (int *)0xFF200100;  // PS/2 base address
  int PS2_data, RVALID;

  // Process all pending inputs
  while (1) {
    PS2_data = *PS2_ptr;
    RVALID = (PS2_data & 0x8000) >> 15;  // Check if there's valid new data
    if (!RVALID) {                       // Exit if no data is available
      break;
    }

    unsigned char code = PS2_data & 0xFF;  // Extract scan code

    // Handle special codes:
    if (code == 0xE0) {  // Extended code: next code is for an extended key
      extended = 1;
      continue;
    } else if (code == 0xF0) {  // Break code: indicates key release (we
                                // ignore movement on release)
      break_code = 1;
      continue;
    }

    // Only process if this is an extended key (for arrow keys)
    if (extended) {
      if (!break_code) {     // Key press event
        if (code == 0x75) {  // Up arrow scan code
          mario_y -= 5;      // Move Mario up by 5 units (adjust as needed)
        } else if (code == 0x72) {  // Down arrow scan code
          mario_y += 5;             // Move Mario down by 5 units
      }else if (code == 0x6B  ){//move left 
        mario_x -= 3;
      }else if (code == 0x74){//move right 
        mario_x +=3;
      }
      }
      // Reset the flags after processing the extended code
      extended = 0;
      break_code = 0;
    } else {
      if (!break_code) {
        if (code == 0x29) {
          fire = true;
        }
        if (code == 0x76) {
          stop = true;
        }
        if (code == 0x5A) Gamestart = true;
      }
      break_code = 0;
    }
  }
}
void shift_old_positions() {
  x_old2 = x_old;  // Previous becomes two frames ago.
  y_old2 = y_old;
  x_old = mario_x;  // Current becomes previous.
  y_old = mario_y;
}
void shift_bull_old_positions() {
  for (int i = 0; i < MAX_BULLETS; i++) {
    bullx_old2[i] = bullx_old[i];
    bully_old2[i] = bully_old[i];
    bullx_old[i] = bullets[i].x;
    bully_old[i] = bullets[i].y;
  }
}

void bullet_shooting() {  // get ready to fire
  for (int i = 0; i < MAX_BULLETS; i++) {
    if (!bullets[i].active) {
      bullets[i].x = mario_x + 26;
      bullets[i].y = mario_y + 7;
      bullets[i].active = true;

      bullx_old[i] = bullets[i].x;
      bully_old[i] = bullets[i].y;
      bullx_old2[i] = bullets[i].x;
      bully_old2[i] = bullets[i].y;
      break;  // only shoot one bullet per fire
    }
  }
}

void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
  *pixel_ctrl_ptr = 1;  // Trigger buffer swap.

  // Wait for swap to start
  while ((*(pixel_ctrl_ptr + 3) & 0x01) == 1) {
    // Busy-wait until swap is complete.
  }
}

void clear_screen() {
  for (int row = 0; row < SCREEN_HEIGHT; row++) {
    for (int col = 0; col < SCREEN_WIDTH; col++) {
      plot_pixel(col, row, COLOR_BLACK);
    }
  }
}
void plot_pixel(int x, int y, short int color) {
  volatile short int *pixel_addr =
      (volatile short int *)(pixel_buffer_start + (y << 10) + (x << 1));
  *pixel_addr = color;
}
