void plot_image_bg(int x, int y) {
  for (int i = 0; i < 240; i++) {
    for (int j = 0; j < 320; j++) {
      unsigned short color = bg[i * 320 + j];
      if (color != 0xDEAD)  // Skip transparent
        plot_pixel(x + j, y + i, color);
    }
  }
}

void erase_image_bg(int x, int y) {
  for (int i = 0; i < 240; i++) {
    for (int j = 0; j < 320; j++) {
      if (bg[i * 320 + j] != 0xDEAD) plot_pixel(x + j, y + i, 0);
    }
  }
}
