void plot_image_Start_Screen(int x, int y) {
  for (int i = 0; i < 240; i++) {
    for (int j = 0; j < 320; j++) {
      unsigned short color = Start_Screen[i * 320 + j];
      if (color != 0xDEAD)  // Skip transparent
        plot_pixel(x + j, y + i, color);
    }
  }
}

void erase_image_Start_Screen(int x, int y) {
  for (int i = 0; i < 240; i++) {
    for (int j = 0; j < 320; j++) {
      if (Start_Screen[i * 320 + j] != 0xDEAD) plot_pixel(x + j, y + i, 0);
    }
  }
}

void play_audio(int *samples, int n, int step, int replicate) {
    int i;
    // Clear output FIFOs and resume conversion
    audio->control = 0x8;
    audio->control = 0x0;
    for (i = 0; i < n; i += step) {
        for (int r = 0; r < replicate; r++) {
            // Wait until there is space in the FIFO
            while (audio->write_available == 0);
            // Write the sample to both channels
            audio->left_data = samples[i];
            audio->right_data = samples[i];
        }
    }
}

void display_on_hex(int time) {
  volatile int *hex_base = (int *)0xFF200020;

  int tens = (time / 10) % 10;
  int ones = time % 10;

  int hex_values[10] = {0x3f, 0x06, 0x5b, 0x4f, 0x66,
                        0x6d, 0x7d, 0x07, 0x7f, 0x6f};

  *hex_base = (hex_values[tens] << 8) | hex_values[ones];
}

bool check_enemy_mario_collisions() {
  if (frame_count == 0) return false;

  for (int j = 0; j < Max_Enemies; j++) {
    if (!enemies[j].active) continue;

    if (AABB_collision(mario_x, mario_y, 28, 32, enemies[j].x, enemies[j].y,
                       Enemies_WIDTH, Enemies_HEIGHT)) {
      return true;
    }
  }
  return false;
}

// Function taken from: "
double sqroot(double square) {
    double root=square/3, last, diff=1;
    if (square <= 0) return 0;
    do {
        last = root;
        root = (root + square / root) / 2;
        diff = root - last;
    } while (diff > MINDIFF || diff < -MINDIFF);
    return root;
}
